unsigned int no_math_erfc(float in)
{
    int index;
    union Number out;
    if(in > 2.5)
        return 0.0;
    else if(in <= -2.5)
        return 2.0;
    //convert the input to a useable index
    index = (int)(in*100 + 250);
    
    out.f = ERFC_TAB[index];
    return out.i;
}

unsigned int no_math_sqrt(int in)
{
  union Number out;
  if(in >= SQRT_TAB_MIN && in < SQRT_TAB_MAX)
  {
    out.f = SQRT_TAB[in];
    return out.i;
  }
  return -1;
}
